import React from "react";
import { animal } from "../../interfaces";
import Animal from "../Animal/Animal"
import Card from "../UI/Card";

interface props {
    animals: animal[]
}

const Animals : React.FC<props> = ({animals}) =>  {

    return (
        <>
            {animals.map((animal: animal) =>
                <Animal>
                    key={animal.id}
                    title={animal.title}
                    amout={animal.amount}
                </Animal>
            )}
        </>
    );
}

export default Animals
